const Confirm = ({ nextStep, preStep, values}) => {
    return ( 
        <div>
            <ul>
                <li>
                    <h3>First Name</h3>
                    <p>{values.firstName}</p>
                    </li>
            </ul>
        </div>
     );
}
 
export default Confirm;
